window.bookSummaryJSON = "<p>I look her body up and down as I circle her. </p> <p>Mine? </p> <p>I smile a devious, deviant, I'm-gonna-make-you-sorry-you-ever-started-playing-this-game-with-me smile. </p> <p>And then I take her hand. </p> <p>I lead her to the elevator. </p> <p>We go up to my apartment. </p> <p>I tie her wrists together with rope. </p> <p>Raise her arms above her head. </p> <p>And chain her to the ceiling. </p> <p>It's my turn. </p>"; 
